import './App.css';
import axios from 'axios';

axios({
  method: 'post',
  url: '/user/1',
  data: {
    memberId: '1',
    name: '조용주',
    email: 'asdf',
  },
})
  .then(function (data) {
    console.log(data);
  })
  .catch(function (error) {
    console.log(error);
  });

function App() {
  return (
    <>
      <button
        onClick={() => {
          axios
            .get('http://8080')
            .then((결과) => {
              console.log(결과.data);
            })
            .catch(() => {
              console.log('실패함');
            });
        }}
      >
        데이터 받아오기
      </button>
    </>
  );
}

export default App;
